ARI DE ALmEIDA

Art. 1o Fica criado Grupo de Trabalho para estabelecer procedimentos internos para tramitacao de 
processos e expedientes de contratacao de obras publicas, em conformidade com as competencias 
das Unidades Organicas da Secretaria de Obras.
Paragrafo Unico - Os procedimentos acima descritos deverao abordar tanto a tramitacao fisica 
quanto a informatizada dentro do INFOBRAS, bem como as competencias e inter-relacoes entre 
os setores desta Secretaria a serem previstas no Regimento Interno.
Art. 2o Os procedimentos deverao abordar todas as etapas desenvolvidas no ambito da Secretaria 
de Obras do Distrito Federal, a saber:
I- Demandas;
II- Projetos;
III- Licitacoes;
Iv- Contratos;
v- Obras e;
vI- Captacao de Recursos.
Paragrafo Unico - Os procedimentos deverao respeitar tanto a legislacao pertinente como tambem 
as Decisoes e Acordaos dos Orgaos de Controle Distritais e Federais.
Art. 2o Farao parte deste Grupo de Trabalho representantes dos seguintes setores:
I- Gabinete;
II- Unidade de Controle Interno;
III- Assessoria Juridico-Legislativa;
Iv- Subsecretaria de Acompanhamento, Controle e Fiscalizacao de Obras  SACF;
v- Subsecretaria de Coordenacao Orcamentaria e Planejamento  SUCOP;
vI- Subsecretaria de Projetos SUPROJ;
vII- Subsecretaria de Gerenciamento de Programas de Obras  SGPO;
vIII- Subsecretaria de monitoramento de Parcerias Publico-Privadas  SUmOP;
IX- Subsecretaria de Controle Estrategico  SUCES;
X- Subsecretaria de Convenios e Obras Especiais  SUCOE;
XI- Subsecretaria de Administracao Geral SUAG.
 1o A coordenacao dos trabalhos ficara por conta do Chefe da Unidade de Controle Interno.
 2o Podera ser solicitada a participacao de algum outro setor desta Secretaria nao especificado 
nesta portaria, caso seja necessario;
Art. 3o Ficam designados para composicao do Grupo de Trabalho os titulares dos setores acima 
relacionados que deverao ainda indicar 01(um) suplente para substitui-los em caso de ausencia.
Art. 5o O Grupo de Trabalho se reunira todas as quintas-feiras, das 14h30 as 18h00 e tera o prazo 
de 60 (sessenta) dias a contar da publicacao desta Portaria, para concluir seus trabalhos.
Art. 6o Esta Portaria entra em vigor na data da sua publicacao
