8.2A dispensa ou substituicao de exigencias somente ocorrera desde que garantido os recursos 
basicos de seguranca contra incendio e panico das pessoas, conforme  1, do art. 23, do RSIP-
-DF, que sao:
8.2.1Saidas de Emergencias;
8.2.2Sinalizacao de Emergencia;
8.2.3Iluminacao de Emergencia; 
8.2.4Extintores de Incendio.
8.3A comprovacao de prejuizo das condicoes estruturais da edificacao, de que trata o  1, do 
art. 23, do RSIP-DF e o item 9.1 desta Instrucao Normativa e processada com a apresentacao da 
seguinte documentacao da edificacao:
8.3.1Requerimento, contendo exposicao de motivos;
8.3.2Laudos Tecnicos;
8.3.3Documentos de Responsabilidade Tecnica dos Laudos Tecnicos;
8.3.4Documentos da edificacao (Carta de Habite-se, Projetos aprovados, Alvara de construcao, 
Alvara de Funcionamento); 
8.3.5Outros documentos comprobatorios dos dados apresentados;
8.3.6Simulacoes computacionais demonstrando o prejuizo da sobrecarga do sistema a ser substituido.
8.4Toda documentacao de requisicao, conforme item 8.3, para dispensa ou substituicao de exigencias 
deve ser assinado pelo responsavel tecnico.
8.5Os Laudos Tecnicos exigidos para substituicao das medidas de seguranca contra incendio e 
panico sao: estudo do projeto estrutural, fundacoes e de compatibilidade dos sistemas.
8.6O Laudo Tecnico exigido para a dispensa de sistema e o do estudo do projeto estrutural 
e fundacoes.
8.7O Laudo Tecnico de estudo do projeto estrutural e de fundacoes da edificacao deve ser apresen-
tado pelo responsavel tecnico e avaliado pelo analista do projeto seguindo os seguintes parametros, 
de acordo com a necessidade de cada caso:
8.7.1Carga maxima admissivel nos pilares e fundacoes;
8.7.2Carga de trabalho atual nos pilares e fundacoes;
8.7.3Carga por pilar e fundacoes a ser acrescida, com a execucao do sistema; 
8.7.4Carga de trabalho nos pilares e fundacoes com a execucao do sistema;
8.7.5Comparacao entre as cargas de trabalho atual, a carga de trabalho com a execucao do sistema 
e a carga maxima admissivel para os pilares e fundacoes; 
8.7.6Estudo de viabilidade do reforco estrutural;
8.7.7Memorial dos calculos estruturais e de fundacao da edificacao; 
8.7.8memorial dos testes de carga eventualmente realizados.
8.8O Laudo Tecnico de compatibilidade das medidas de seguranca contra incendio e panico para 
substituicao deve ser elaborado seguindo os seguintes parametros:
8.8.1Objetivo do sistema substituido e substituto; 
8.8.2Classe de incendio da area protegida;
8.8.3Carga incendio da area protegida, conforme norma especifica;
8.8.4Capacidade de extincao do sistema substituido e substituto, quando for o caso;
8.8.4.1Capacidade extintora, se houver;
8.8.4.2volume (I) da Reserva Tecnica de Incendio;
8.8.4.3Carga (kg) do agente extintor;
8.8.4.4Quantidade de bicos dispersores.
8.8.5Automacao do sistema substituido e substituto;
8.8.6Distribuicao e distancias dos aparelhos ou bicos das medidas de seguranca contra incendio e 
panico substituido e substituto; 
8.8.7Risco de incendio, conforme Norma Tecnica no002/2009-CBmDF;
8.8.8Certificacao das medidas de seguranca contra incendio e panico a serem instalados.
8.9A substituicao de exigencias de seguranca contra incendio e panico somente podera ocorrer 
entre meios e as medidas de seguranca contra incendio e panico compativeis.
8.10A compatibilidade somente ficara comprovada quando os objetivos forem iguais e quando 
a capacidade de extincao do sistema substituto for igualou maior que a do sistema substituido.
8.11A opcao entre dispensa ou substituicao fica a criterio do CBMDF, observando sempre a melhora 
da seguranca contra incendio e panico da edificacao.
8.12O analista deve registrar no parecer tecnico os documentos apresentados, bem como sua 
pertinencia e relevancia ao requerimento.
8.13O analista pode empreender pesquisa documental, bibliografia e ensaios previstos em normas 
tecnicas para emitir o parecer tecnico.
8.14Todos os casos de isencao ou substituicao das medidas de seguranca contra incendio e panico 
serao encaminhado ao DIEAP, que podera submeter ao CONSEG caso necessario.
9PROCEDImENTOS ADmINISTRATIvOS PARA DISPENSA OU SUBSTITUICAO DAS 
mEDIDAS DE SEGURANCA CONTRA INCENDIO E PANICO
9.1O analista de projetos, designado pelo diretor da DIEAP, fara a analise do requerimento e emitira 
o competente Parecer Tecnico instruindo tecnicamente, no prazo de 15 dias, para avaliacao do 
diretor da DIEAP e deliberacao do Chefe do DESEG.
9.1.1O prazo podera ser prorrogado por ate 15 dias mediante a complexidade do projeto e solicitacao 
do analista ao diretor da DIEAP.
9.2O diretor da DIEAP fara avaliacao do requerimento apresentado e do parecer tecnico emitido 
pelo analista, no prazo maximo de 5 dias, encaminhando-o para a deliberacao do Chefe do DESEG.
9.3A deliberacao sobre a dispensa das exigencias e de competencia do Chefe do DESEG, mediante 
deliberacao/conclusao do COSEG, conforme estabelece o  1, do art. 23, combinado com art. 
25, do RSIP-DF.
9.4A solucao do requerimento de dispensa das exigencias sera disponibilizada ao interessado, no 
protocolo do DESEG, no prazo maximo de 5 dias, a contar da deliberacao do Chefe do DESEG.
9.5A decisao do DESEG sera comunicada mediante oficio, com parecer tecnico anexo apresentando 
as razoes tecnicas da deliberacao.

