O SECRETARIO DE ESTADO DE CIENCIA, TECNOLOGIA E INOvACAO DO DISTRITO 
FEDERAL, O SECRETARIO DE ESTADO CHEFE DA ASSESSORIA INTERNACIONAL DO 
