 FAP/DF, no uso das atribuicoes que lhes sao conferidas pelo artigo 105, incisos III e V, da Lei 
Organica do Distrito Federal, e artigo 6o, inciso I, alineas b, d e e do Decreto no 34.546, de 
1o de agosto de 2013, e de acordo com a Portaria no 09, de 18 de setembro de 2013, RESOLvEm:
Art. 1o Divulgar as modalidades do Programa Brasilia Sem Fronteiras 2014, conforme segue:
I  Brasilia Sem Fronteiras Ensino medio Sanduiche (BSF - EmS):
a) Publico: Estudantes regularmente matriculados no ensino medio da rede publica de ensino da 
Secretaria de Estado de Educacao do Distrito Federal;
b) vagas: 1000 (mil);
c) Localidades: America do Sul, America do Norte, Europa e Oceania;
d) Duracao: de 05 a ate 06 meses.
II  Brasilia Sem Fronteiras Estudantes dos Centros Interescolares de Linguas (BSF - CIL):
a) Publico: Estudantes dos Centros Interescolares de Linguas, da Secretaria de Estado de 
Educacao do Distrito Federal;
b) vagas: 400 (quatrocentas);
c) Localidades: Argentina, Belgica e Estados Unidos da America;  
d) Duracao: de 04 a ate 12 semanas.
III  Brasilia Sem Fronteiras Servidores Publicos (BSF  SPU):
a) Publico: Servidores Publicos do Distrito Federal;
b) vagas: 400 (quatrocentas);
c) Localidades: Austria, Cingapura, Coreia do Sul, Espanha, Estados Unidos da America 
e Holanda;  
d) Duracao: de 04 a ate 12 semanas.
Iv  Brasilia Sem Fronteiras Universitarios (BSF - UNI):
a) Publico: Estudantes de Instituicoes de Ensino Superior do Distrito Federal;
b) vagas: 200 (duzentas) vagas;
c) Localidades: Estados Unidos da America e Holanda;  
d) Duracao: de 04 a ate 12 semanas.
Art. 2o Para realizacao do programa Brasilia Sem Fronteiras 2014 sera necessaria a contratacao 
de instituicao de excelencia especializada em servicos de educacao superior, processos seletivos, 
assessoramento didatico-pedagogico, treinamento e avaliacao de desempenho.
Art. 3o Esta Portaria Conjunta entra em vigor na data de sua publicacao.
